var Cons = function(){
    var self = this;
    self.data = [
        {id:0, code:'REGISTER', des:"新注册用户"},
        {id:1, code:'LOGIN', des:"连续登录"},
        {id:2, code:'RUNTIME', des:"时间积累"}
    ];

    self.id = {};

    for(var i = 0; i < self.data.length; i++)
    {
        var set = self.data[i];
        self[set.code] = set;

        self.id[set.id] = set;
    }
};
module.exports = new Cons();

